.{{= name }} table {
}

table, tr, td, th {
    border: 1px solid #000;
    position: relative;
    padding: 5px;
}

th.rotate span {
    transform-origin: 0 50%;
    transform: rotate(-90deg); 
    white-space: nowrap; 
    display: block;
    position: absolute;
    bottom: 0;
    left: 50%;
}

.{{= name }} {
}

.{{= name }} > header {
    text-align: center;
}


.ui.menu .item img.logo {
    margin-right: 1.5em;
}
.main.container {
    margin-top: 5em;
}
.wireframe {
    margin-top: 2em;
}
.ui.footer.segment {
    margin: 5em 0em 0em;
    padding: 5em 0em;
}

var w = $("#"+id);

endpoint.schema('meta_meta').view('checker').rows().then(function(results) {
    widget.sync(results, w.find('table.checker tbody'), function(result) {
        return widget('meta:meta_meta_results_row', { result: result});
    });


    $(function() {
        var header_height = 0;
        $('table th span').each(function() {
            if ($(this).outerWidth() > header_height) header_height = $(this).outerWidth();
        });

        $('table th').height(header_height);
    });
});
